inline const SAR *GetSizePrefixedSAR(const void *buf) {
  return ::flatbuffers::GetSizePrefixedRoot<SAR>(buf);
}

inline const char *SARIdentifier() {
  return "$SAR";
}

inline bool SARBufferHasIdentifier(const void *buf) {
  return ::flatbuffers::BufferHasIdentifier(
      buf, SARIdentifier());
}

inline bool SizePrefixedSARBufferHasIdentifier(const void *buf) {
  return ::flatbuffers::BufferHasIdentifier(
      buf, SARIdentifier(), true);
}

